        void Ruta(Dictionary<string, Double[]> openWith)
        {
            string line;
            double[] value;
            Location lugar = new Location();
            MapPolyline polyline = new MapPolyline();
            polyline.Stroke = new System.Windows.Media.SolidColorBrush(System.Windows.Media.Colors.Blue);
            polyline.StrokeThickness = 5;
            polyline.Opacity = 0.7;
            polyline.Locations = new LocationCollection();

            //Poner un while(no haya nada en ciudades.txt) --> Seguir en loop
            System.IO.StreamReader file =
     new System.IO.StreamReader(@"C:\Users\esteban\Documents\Lisp\ciudades.txt");
            line = file.ReadToEnd();
            //while ((line = file.ReadToEnd()) != null)
            //{
            char[] sep = { ' ','(',')'};
            string[] places = line.Split(sep);

            foreach (string place in places)
            {
                //System.Windows.MessageBox.Show(place.Trim());
                if (openWith.TryGetValue(place.Trim(), out value))
                {
                    Console.WriteLine("For key = " + line + " Latitud = {0}.", value[0]);
                    Console.WriteLine("For key = " + line + " Longitud = {0}.", value[1]);
                    Console.WriteLine("For key = \"tif\", value = {0}.", value);
                    polyline.Locations.Add(new Location(value[0], value[1]));

                    Pushpin pinn = new Pushpin();
                    pinn.Location = new Location(value[0], value[1]);

                    // Adds the pushpin to the map.
                    myMap.Children.Add(pinn);

                }
                else
                {
                    Console.WriteLine("Key "+place.Trim()+" is not found.");
                }
            }
            //}

            file.Close();
            myMap.Children.Add(polyline);
            

        }


    void addNewPolyline()
    {
        MapPolyline polyline = new MapPolyline();
        polyline.Stroke = new System.Windows.Media.SolidColorBrush(System.Windows.Media.Colors.Blue);
        polyline.StrokeThickness = 5;
        polyline.Opacity = 0.7;
        polyline.Locations = new LocationCollection() { 
            new Location(47.6424, -122.3219), 
            new Location(47.8424,-122.1747), 
            new Location(47.67856,-122.130994)};
        polyline.Locations.Add(new Location(19.4326077, -99.133208));

            myMap.Children.Add(polyline);
    }

